import logo from "./logo.svg";

import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

import Footer from "./components/admin/footer/Footer";
import Header from "./components/admin/header/Header";
import Menu from "./components/admin/menu/Menu";
import AdminProductType from './components/admin/content/ProductTypeContent'
import AdminProductContent from "./components/admin/content/ProductAddContent";
function App() {
  return (
    <BrowserRouter>
      <Switch>

      <Header />
          <Menu />
        <Route path="/" exact>
          <AdminProductContent />
        </Route>
        <Route path="/" exact>
          <Header />
          <Menu />
          <AdminProductType />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
